import React, { useState } from 'react';
import FileUploader from './components/FileUploader';
import ClauseHighlighter from './components/ClauseHighlighter';
import RiskSummary from './components/RiskSummary';
import SimulationCharts from './components/SimulationCharts';
import { analyzeContract } from './api';
import { Loader2, Scale } from 'lucide-react';
import './index.css';

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [error, setError] = useState(null);

  const handleFileSelect = (file) => {
    setSelectedFile(file);
    setError(null);
    if (file) {
      handleAnalyze(file);
    } else {
      setAnalysisResult(null);
    }
  };

  const handleAnalyze = async (file) => {
    if (!file) return;

    setIsLoading(true);
    setError(null);

    try {
      const result = await analyzeContract(file);
      if (result.status === 'success') {
        setAnalysisResult(result);
      } else {
        setError(result.error || 'Analysis failed');
      }
    } catch (err) {
      setError(err.error || 'Failed to analyze contract');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-sm border-b">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            <div className="flex items-center space-x-3">
              <Scale className="w-8 h-8 text-blue-600" />
              <h1 className="text-2xl font-bold text-gray-900">NyayMitra</h1>
              <span className="text-sm text-gray-500">AI Legal Contract Analyzer</span>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
        {/* Upload Section */}
        <div className="mb-6">
          <FileUploader onFileSelect={handleFileSelect} isLoading={isLoading} />

          {error && (
            <div className="mt-4 p-4 bg-red-50 border border-red-200 rounded-lg">
              <p className="text-red-800">{error}</p>
            </div>
          )}

          {isLoading && (
            <div className="mt-4 p-4 bg-blue-50 border border-blue-200 rounded-lg flex items-center space-x-3">
              <Loader2 className="w-5 h-5 animate-spin text-blue-600" />
              <p className="text-blue-800">Analyzing contract with AI agents...</p>
            </div>
          )}
        </div>

        {/* Analysis Results */}
        {analysisResult && (
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 h-[calc(100vh-200px)]">
            {/* Left Column */}
            <div className="space-y-6">
              {/* Risk Summary - Bottom Left */}
              <div className="bg-white rounded-lg shadow-sm border p-6 h-full">
                <RiskSummary 
                  summary={analysisResult.summary} 
                  simulation={analysisResult.simulation} 
                />
              </div>
            </div>

            {/* Right Column */}
            <div className="grid grid-rows-2 gap-6">
              {/* Clause Highlighter - Top Right */}
              <div className="bg-white rounded-lg shadow-sm border p-6">
                <ClauseHighlighter riskReport={analysisResult.risk_report} />
              </div>

              {/* Simulation Charts - Bottom Right */}
              <div className="bg-white rounded-lg shadow-sm border p-6">
                <SimulationCharts simulation={analysisResult.simulation} />
              </div>
            </div>
          </div>
        )}

        {/* Welcome Message */}
        {!analysisResult && !isLoading && (
          <div className="text-center py-12">
            <Scale className="w-16 h-16 text-gray-400 mx-auto mb-4" />
            <h2 className="text-2xl font-semibold text-gray-900 mb-2">
              Welcome to NyayMitra
            </h2>
            <p className="text-gray-600 max-w-md mx-auto">
              Upload a legal contract PDF to get started. Our AI agents will analyze risks, 
              provide summaries, and simulate negotiation outcomes.
            </p>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
